import React from "react";
import "./style.css";
class FriendCard extends React.Component {
// function FriendCard(props) {
  render() {
  return (
    <div className="card">
      <div className="img-container">
        <img src={this.image} />
      </div>
      <div className="content">
      </div>
    </div>
  );
}

}
export default FriendCard;
